export default function Cards(props) {
    const cardElements = props.data.map(card => {
        return (
            <div className="card">
                <h4><u><a href={props.data.link}>{props.data.course} &bull; {props.data.school}</a></u><br/><i className="main--date">{props.data.from} - {props.data.to}</i></h4>
                <p>{props.data.para}</p>
            </div>
        )
    })
    return (
        {cardElements}
    )
}
